		/** 
		 * @event
		 * @param   {object} _this
		 * @param   {object} e     event object
		 * @param   {object} eOpts The options object passed to [Ext.util.Observable.addListener](https://docs.sencha.com/extjs/6.0.1/classic/Ext.util.Observable.html#method-addListener).
		 * @returns {void}   
		 */
