		/** 
		 * @event
		 * @param   {object} _this
		 * @param   {object} e     event object
		 * @param   {object} eOpts The options object passed to [Ext.util.Observable.addListener](https://docs.sencha.com/extjs/6.0.1/classic/Ext.util.Observable.html#method-addListener).
		 * @returns {void}   
		 */
		dragstart? (_this: object, e: object, eOpts: object): void;
		/** 
		 * Fires when the mouse button is pressed down, but before a drag operation begins. The
		 * drag operation begins after either the mouse has been moved by [tolerance](https://docs.sencha.com/extjs/6.0.1/classic/Ext.dd.DragTracker.html#cfg-tolerance) pixels,
		 * or after the [autoStart](https://docs.sencha.com/extjs/6.0.1/classic/Ext.dd.DragTracker.html#cfg-autoStart) timer fires.
		 * 
		 * Return `false` to veto the drag operation.
		 * @event
		 * @param   {object} _this
		 * @param   {object} e     event object
		 * @param   {object} eOpts The options object passed to [Ext.util.Observable.addListener](https://docs.sencha.com/extjs/6.0.1/classic/Ext.util.Observable.html#method-addListener).
		 * @returns {void}   
		 */
		mousedown? (_this: object, e: object, eOpts: object): void;
		/** 
		 * Fired when the mouse is moved. Returning false cancels the drag operation.
		 * @event
		 * @param   {object} _this
		 * @param   {object} e     event object
		 * @param   {object} eOpts The options object passed to [Ext.util.Observable.addListener](https://docs.sencha.com/extjs/6.0.1/classic/Ext.util.Observable.html#method-addListener).
		 * @returns {void}   
		 */
